pub enum ErrorCode {

    /// Internal logic error in SQLite
    InternalMalfunction,

    /// Access permission denied
    PermissionDenied,

    /// Callback routine requested an abort
    OperationAborted,

    /// The database file is locked
    DatabaseBusy,

    /// A table in the database is locked
    DatabaseLocked,

    /// A malloc() failed
    OutOfMemory,

    /// Attempt to write a readonly database
    ReadOnly,

    /// Operation terminated by sqlite3_interrupt()
    OperationInterrupted,

    /// Some kind of disk I/O error occurred
    SystemIOFailure,

    /// The database disk image is malformed
    DatabaseCorrupt,

    /// Unknown opcode in sqlite3_file_control()
    NotFound,

    /// Insertion failed because database is full
    DiskFull,

    /// Unable to open the database file
    CannotOpen,

    /// Database lock protocol error
    FileLockingProtocolFailed,

    /// The database schema changed
    SchemaChanged,

    /// String or BLOB exceeds size limit
    TooBig,

    /// Abort due to constraint violation
    ConstraintViolation,

    /// Data type mismatch
    TypeMismatch,

    /// Library used incorrectly
    APIMisuse,

    /// Uses OS features not supported on host
    NoLargeFileSupport,

    /// Authorization denied
    AuthorizationForStatementDenied,

    /// 2nd parameter to sqlite3_bind out of range
    ParameterOutOfRange,

    /// File opened that is not a database file
    NotADatabase,

    /// SQL error or missing database
    Unknown,
}

pub enum Limit {

    /// The maximum size of any string or BLOB or table row, in bytes.
    SQLITE_LIMIT_LENGTH = ,

    /// The maximum length of an SQL statement, in bytes.
    SQLITE_LIMIT_SQL_LENGTH = ,

    /// The maximum number of columns in a table definition or in the result set
    /// of a SELECT or the maximum number of columns in an index or in an
    /// ORDER BY or GROUP BY clause.
    SQLITE_LIMIT_COLUMN = ,

    /// The maximum depth of the parse tree on any expression.
    SQLITE_LIMIT_EXPR_DEPTH = ,

    /// The maximum number of terms in a compound SELECT statement.
    SQLITE_LIMIT_COMPOUND_SELECT = ,

    /// The maximum number of instructions in a virtual machine program used to
    /// implement an SQL statement.
    SQLITE_LIMIT_VDBE_OP = ,

    /// The maximum number of arguments on a function.
    SQLITE_LIMIT_FUNCTION_ARG = ,

    /// The maximum number of attached databases.
    SQLITE_LIMIT_ATTACHED = ,

    /// The maximum length of the pattern argument to the LIKE or GLOB
    /// operators.
    SQLITE_LIMIT_LIKE_PATTERN_LENGTH = ,

    /// The maximum index number of any parameter in an SQL statement.
    SQLITE_LIMIT_VARIABLE_NUMBER = ,

    /// The maximum depth of recursion for triggers.
    SQLITE_LIMIT_TRIGGER_DEPTH = ,

    /// The maximum number of auxiliary worker threads that a single prepared
    /// statement may start.
    SQLITE_LIMIT_WORKER_THREADS = ,
}
